('46d592526214456081f8ea55b20e156e', 'f1c1a540db8a43689bcd218769fbf06f', '6c35b36d0ed84ea48476d6b0a03d4fa0', 1, 103, 'Achterbahn-128/80', 'Achterbahn-128/80', 1, 'In cryptography, Achterbahn is the name of a synchronous stream cipher algorithm submitted to the eSTREAM Project of the eCRYPT network. In the final specification the cipher is called ACHTERBAHN-128/80, because it supports the key lengths of 80 bits and 128 bits, respectively. Achterbahn was developed by Berndt Gammel, Rainer Gttfert and Oliver Kniffler. Achterbahn means rollercoaster (in German), though a literal translation of the term would be eight-track, which indicates that the cipher can encrypt eight bit streams in parallel. ACHTERBAHN-128 is downward compatible and can produce the same keystream as ACHTERBAHN-80 if so desired. The keystream generator of ACHTERBAHN-128/80 is based on the design principle of the nonlinear combination generator, however it deploys primitive nonlinear feedback shift registers (NLFSR) instead of linear ones (LFSR).', '', NULL, NULL, NULL, '2b7272f6bad5404d879e37d9a3a265b9', NULL, NULL, '2b7272f6bad5404d879e37d9a3a265b9', NULL, NULL, NULL, '2017-10-24 03:12:32', '0000-00-00 00:00:00', 3),
