('e839f274ad50462dbf3a04481ea38b37', '897c2da204f0405082be79b955b6ea43', '35575f3e63f24b1298c2709a1d46abfd', 1, 103, 'Pht trin gii thut lp lch trn nn tng ROS cho robot di ng', 'Develop a path planning algorithm for ROS-based mobile robot', 1, 'Da trn mt robot di ng s dng nn tng ROS, c trang b Kit NVIDIA TX2 v cm bin nh RGB-D, cm bin gia tc, mt gii thut lp lch c pht trin v tch hp vo h iu hnh. Gii thut ny s dng thng tin v v tr thng qua cm bin gia tc, thng tin v vt cn 3D thng qua cm bin RGB-D. Gii thut c nh gi thng qua mt h camera gim st c lp.\n\nBased on a ROS-based mobile robot, equipped with one Kit NVIDIA TX2, one RGB-D camera and one accelerometer sensor, a path planning algorithm is developed and integrated into the operating system. Location is estimated by observing the accelerometer sensor and obstacles\' information is retrieved by the RGB-D camera. The algorithm is evaluated by an independent camera system.', 'Path planning, Mobile robot, ROS, RGB-D', NULL, NULL, NULL, '827065e3080a4077a7bf3e29da4920d5', '2721cbe23b8e42c596a389d0e18ff8eb', NULL, '827065e3080a4077a7bf3e29da4920d5', NULL, NULL, NULL, '2017-10-24 03:12:33', '0000-00-00 00:00:00', 3),
