('e9bb5bdaac3943b1a57ed64751bcb22c', '6f8aaf34f8484702b793242633deccc5', '6c35b36d0ed84ea48476d6b0a03d4fa0', 1, 103, 'D on tng tc protein-protein s dng mng n ron tch chp', 'Protein-protein interaction prediction using Convolutional Neural Network', 1, 'Protein-protein interactions (PPIs) play a vital role in understanding biological cellular functions.Therefore, detecting PPIs will bring great impacts to the studying of many fields, including not biology itself only, but also pharmacology and health science. However, doing experiments for PPIs detecting is considered to be both time-consuming and expensive. With the purpose of building such a technique which can provide a decent prediction for PPIs, my work here focuses on using Deep Learning for prediction to reduce the number of experiments need to be done for identifying PPIs.', 'Tin sinh hc, Hc my', NULL, NULL, NULL, '3470f24e13a34279918a11adc57b46af', NULL, NULL, '3470f24e13a34279918a11adc57b46af', NULL, NULL, NULL, '2017-10-24 03:12:33', '0000-00-00 00:00:00', 3),
